{"p": "And they delivered it all three weeks ahead of schedule."}
{"p": "During this project, Focused Labs\u2019 developers worked alongside Aperture\u2019s to show the benefits of pair programming. Aperture wanted to move away from a waterfall type workflow to more iterative development. Focused Labs showed Aperture\u2019s team the benefits of things like weekly team rituals and a cadenced release schedule for a project in progress."}
{"p": "Focused Labs also collaborated with Aperture to bring more modern tooling into their work environment. When partnering with development teams, Focused Labs always looks to implement new modern systems. With Aperture, the legacy applications they were previously working with made it virtually impossible to find out when the software Aperture was providing to its clients was faltering. To close that feedback loop between Aperture\u2019s clients and Aperture, Focused Labs suggested and then implemented new tooling \u2014 such as New Relic \u2014 to facilitate performance monitoring.

